Het verhaal over Prinses Rapunzel, die als baby is gestolen uit het paleis van haar ouders en door een heks genaamd Mother 

Gothel wordt opgesloten in een verborgen hoge toren, waar ze onmogelijk uit kan ontsnappen. Ze snakt naar avontuur in haar leven 

en droomt ervan de toren te verlaten om te zien waar de vreemde lichten, die ze elk jaar op haar verjaardag ziet, vandaan komen. 

Dat avontuur kan eindelijk beginnen als de knapste, maar ook beruchtste, crimineel van het koninkrijk, Flynn Rider, langs haar 

toren komt en naar boven klimt om zich te verstoppen. Ze maken samen de afspraak om uit de toren te ontsnappen en op zoek te 

gaan naar de lichten. Onderweg ontmoeten ze vele hilarische figuren en beleven ze een magisch avontuur.


