Storyline

The story of Princess Rapunzel, whose baby is stolen from the palace of her parents and by a witch named Mother 
Gothel are locked in a hidden tower, where they are impossible to escape. She yearns for adventure in her life 
and dreams of leaving the tower to see where the strange lights, which they see every year on her birthday, come. 
This adventure can finally begin when the prettiest, but most infamous, criminal of the kingdom, Flynn Rider down her 
tower comes and climbs up to hide. Together they make the appointment from the tower to escape and seek 
go to the lights. En route they encounter many hilarious characters and they enjoy a magical adventure.
